import React from 'react';
import styled from 'styled-components'

const Bodywrapper = styled.body `
    display: relative;
    margin: -0.5rem;
    height: 25rem;
    margin-top: 2rem;
    background-color: #2A2F36; 

    .container {
        background-color: #2A2F36; 
    }
    p{
        color: var(--mainWhite);
        position: relative;
        font-family: 'Montserrat', sans-serif;
        font-size: 400%;

    }

`
const Mark = styled.mark `
    color: var(--mainRed);
    background-color: var(--mainDarkblue);
    text-decoration: underline;

`




function Body() {
  return (
      <Bodywrapper>
          <div className = "container">
            <p className = "first">Välkommen, här finner du <Mark>material</Mark> för teknisk fysik.</p>
          </div>
      </Bodywrapper>

  );
}

export default Body;
